import styled from "styled-components";

export default styled.div`
    height: 8vh;
    width: 12vw;
    border-radius: .8vw;
    border-width: .2vw;
    border-color: ${props => (props.butn ? "white" : "transparent")};
    background-color: blue; 
    color: white;
    text-align: center;
    vertical-align: center;
`;
